// src/components/GuidePage.js
import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom'; // react-router-domから必要なコンポーネントをインポート
import AuthForm from './AuthForm'; // AuthFormコンポーネントをインポート
import GuideMyPage from './GuideMyPage'; // ガイドのマイページコンポーネントをインポート

function GuidePage() {
  return (
    <Router>
      <div>
        {/* ガイド情報を登録するためのルート */}
        <Route path="/guide/register" component={AuthForm} />

        {/* ガイドのマイページに遷移 */}
        <Redirect from="/guide" to="/guide/mypage" />

        {/* ガイドのマイページを表示 */}
        <Route path="/guide/mypage" component={GuideMyPage} />
      </div>
    </Router>
  );
}

export default GuidePage;
